電子レンジ対応のプーさんレンジパック3点セットです。<br>
サイズで使い分け、空気弁付きなのでフタを取らずにお使い頂けますので、かなり実用的です。<br><br>
【サイズ：大】直径18.5cm×高さ9.5cm<br>
【サイズ：中】直径13cm×高さ5.5cm<br>
【サイズ：小】直径9.8cm×高さ6cm<br>
【サイズ：シリコン】縦14.8cm×横19.5cm<br>
